import React, { Component } from 'react';
import { BrowserRouter as Router, Route,Switch, Redirect} from 'react-router-dom'
import Patient from './patient/patientmain';
import Doctor from './Doctor/Doctormain';
class Home extends Component {
  try = () => {
      this.props.history.push('/Patient');
      this.props.history.push('/doctor')
  }
  render() {
    return (
      <div className="App"><br/><br/><br/>
        <div className="container">
            <button id="b1" onClick ={this.try}>Patient</button>
            <Route path="/Patient" component={Patient}/>
        </div>
        <div className="container">
            <button id="b2" onClick ={this.try}>Doctor</button>
            <Route path="/doctor" component={Doctor}/>
        </div>
        {/* <div className="container">
            <button id="b2" onClick ={this.try}>Click me</button>
            <Route path="/doctor" component={doctor}/>
        </div> */}
      </div>
    );
  }
}
export default () => (
   <div>
      <Router>
           <Route component={Home} />
           
      </Router>
  </div>
);
